import React, { Component } from "react";
import Slider from "react-slick";
// import SlickCard from "./SlickCard";

const Slick = ({ data, Card, numSlide }) => {
  var settings = {
    dots: true,
    infinite: false,
    speed: 500,
    slidesToShow: numSlide,
    slidesToScroll: numSlide,
    initialSlide: 0,
    responsive: [
      {
        breakpoint: 1024,
        settings: {
          slidesToShow: 3,
          slidesToScroll: 3,
          infinite: true,
          dots: true,
        },
      },
      {
        breakpoint: 600,
        settings: {
          slidesToShow: 2,
          slidesToScroll: 2,
          initialSlide: 2,
        },
      },
      {
        breakpoint: 480,
        settings: {
          slidesToShow: 1,
          slidesToScroll: 1,
        },
      },
    ],
  };
  return (
    <div className="mb-3">
      <Slider {...settings}>
        {/* {data.map((item, index) => (
          <Card key={index} data={item} index={index} />
        ))} */}
        {data.map((item, index) => (
          <div>
            <h3 style={{ width: "100%", height: "100%" }}>1</h3>
          </div>
        ))}
      </Slider>
    </div>
  );
};

export default Slick;
